import React, { useEffect, useState } from 'react'
import { Outlet } from 'react-router-dom';
import NavBar from './NavBar'



const RootLayout= ({firstName}) => {

  return (
    <div>

        <header>
        <NavBar firstName={firstName} lastName={lastName}/>
        </header>

        <main>
            <Outlet />
        </main>
    </div>
  )
};


export default RootLayout;
